  false,\n\t\"url\": null,\n\t\"notes\": \"This report discusses the results of a
  vegetation transect line survey done in 1971 at the North Marsh of Prequile National
  Wildlife Refuge. No management had been done since the last survey of the area in
  1969 so the expectation was that there would be little change. The results, however,
  revealed a significant change in the composition of plant species over the two year
  span. Because of this, the refuge has decided to run surveys of this area now every
  year.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
